import React from 'react'

class App extends React.Component {
  constructor () {
    super()
    this.state = {
      array: [1, 2, 3, 4, 5, 6, 7]
    }
  }

  render () {
    return (
      this.state.array.map(item => {
        return <li>{item * 2}</li>
      })
    )
  }
}

export default App
